sys_variable_value.value:
(function execute(inputs, outputs) {
  var criar_conta_AWS = new Criar_conta_AWS();
  var log = criar_conta_AWS.criarContaAWS(inputs.task);
  var glObjto = new GlideRecord('x_gmeps_integracao_aws_log');

  if(glObjto.get(log)){
   	outputs.log = glObjto;
  }

})(inputs, outputs);

